function Closer(){this.stack=[];this.counter=0}Closer.prototype.addElement=function(a){this.stack.push(a[0]);this.counter=1};Closer.prototype.closeElements=function(a){if(this.counter>0){this.counter=0;return false}for(let item in this.stack){let element=this.stack[item];if($(element).find(a).length>0||$(element).is($(a))){}else{$(element).removeClass("open");this.stack.splice(item,1)}}};